(ಎ) "ಪೋಕ್ಸೋಗ್ರಫಿ" ಎಂಬುದು ಬೇರೊಬ್ಬ ವ್ಯಕ್ತಿಯ ಲಾಭಕ್ಕಾಗಿ ಅಥವಾ ಇಬ್ಬರು ಅಥವಾ ಹೆಚ್ಚು
ವ್ಯಕ್ತಿಯರ ಪರಸ್ಪರ ಲಾಭಕ್ಕಾಗಿ ಲೈಂಗಿಕ ಶೋಷಣೆ ಅಥವಾ ದುರುಪಯೋಗದ ಉದ್ದೇಶಗಳಿಗಾಗಿ
ಉಪಯೋಗಿಸಲಾಗುವ ಯಾವುದೇ ಮನೆ, ಕೋಠಿ, ವಾಹನ ಅಥವಾ ಸ್ಥಳ ಅಥವಾ ಯಾವುದೇ ಮನೆ, ಕೋಠಿ,
ವಾಹನ ಅಥವಾ ಸ್ಥಳದ ಯಾವುದೇ ಭಾಗವನ್ನು ಒಳಗೊಳ್ಳುತ್ತದೆ;
(ಎಎ) "ಮಗು" ಎಂದರೆ ಹದಿನಾರು ವರ್ಷಗಳ ವಯಸ್ಸು ತುಂಬಿಲ್ಲದ ವ್ಯಕ್ತಿ;
(ಬಿ) "ಮಾದಕ ಸಂಸ್ಥೆ" ಎಂದರೆ (21ನೇ ಪ್ರಕರಣದ ಮೇರೆಗೆ ಸ್ಥಾಪಿಸಲಾದ ಸಂಸ್ಥೆಯಾಗಿರುವ ಅಥವಾ
ಹಾಗೆ ಸ್ಥಾಪಿಸುವುದಕ್ಕೆ ಲೈಸೆನ್ನು ನೀಡಲಾದ) ಯಾವುದೇ ಹೆಸರಿನಿಂದ ಕರೆಯಲಾಗುವ ಹಾಗೂ ಸುಧಾರಣೆಯ
ಅಗತ್ಯವಾಗಿರುವ ವ್ಯಕ್ತಿಗಳನ್ನು ಈ ಅಧಿನಿಯಮದ ಮೇರೆಗೆ ತಡೆಹಿಡಿದಿಡುವುದಾದ ಸಂಸ್ಥೆ ಮತ್ತು ಇದು ಈ
ಅಧಿನಿಯಮಾನುಸಾರವಾಗಿ ವಿಚಾರಣೆಗಾಗಿನ ವ್ಯಕ್ತಿಗಳನ್ನು ಇಟ್ಟುಕೊಳ್ಳುವಂಥ ಆಶ್ರಯ ಸ್ಥಾನವನ್ನು ಒಳಗೊಳ್ಳುತ್ತದೆ;
(ಸಿ) "ಮಾಧ್ಯಮ" ಎಂದರೆ ಯಾವ ಪ್ರಕರಣದಲ್ಲಿ ಈ ಪದವು ಬಂದಿರುವುದೋ ಮತ್ತು
ಅನುಸೂಚಿಯ ಮೊದಲ ಅಂಕಣದಲ್ಲಿ ಅದನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಲಾಗಿರುವುದೋ ಆ ಪ್ರಕರಣದ ಮೂಲಕ ಪ್ರದಾನ
ಮಾಡಿದ ಅಧಿಕಾರಗಳನ್ನು ಚಲಾಯಿಸಲು ಸಕ್ಷಮವಾಗಿರುವ ಮತ್ತು ಅನುಸೂಚಿಯ ಎರಡನೇ ಅಂಕಣದಲ್ಲಿ
ನಿರ್ದಿಷ್ಟಪಡಿಸಲಾಗಿರುವ ಪ್ರಾಧಿಕಾರ;
(ಸಿಎ) "ಪ್ರಾಪ್ತ ವಯಸ್ಕ" ಎಂದರೆ ಹದಿನೆಂಟು ವರ್ಷ ವಯಸ್ಸು ತುಂಬಿರುವ ವ್ಯಕ್ತಿ;
(ಸಿಬಿ) "ಅಪ್ರಾಪ್ತ ವಯಸ್ಕ" ಎಂದರೆ ಹದಿನಾರು ವರ್ಷ ವಯಸ್ಸು ತುಂಬಿರುವ ಆದರೆ ಹದಿನೆಂಟು ವರ್ಷ
ವಯಸ್ಸು ತುಂಬದ ವ್ಯಕ್ತಿ;
(ಡಿ) "ನಿಯಮಿಸಲಾದ" ಎಂದರೆ ಈ ಅಧಿನಿಯಮದ ಮೇರೆಗೆ ರಚಿಸಿದ ನಿಯಮಗಳ ಮೂಲಕ
ನಿಯಮಿಸಲಾದುದು;
(ಇ) [XXX]
(ಎಫ್) "ವೇಶ್ಯಾವೃತ್ತಿ" ಎಂದರೆ ವಾಣಿಜ್ಯದ ಉದ್ದೇಶಗಳಿಗಾಗಿ ವ್ಯಕ್ತಿಗಳ ಲೈಂಗಿಕ ಶೋಷಣೆ ಅಥವಾ
ದುರುಪಯೋಗ ಎಂಬ ಅರ್ಥ ಮತ್ತು 'ವೇಶ್ಯೆ' ಎಂಬ ಪದವನ್ನು ತದನುಸಾರವಾಗಿ ಅರ್ಥೈಸತಕ್ಕದ್ದು.
